import React from 'react';
import classes from "./CardCart.module.css";
import img from "../../../assets/game_img1.jpg"

const CardCart = () => {
    return (
        <div className={classes.container}>
            <img src={img} alt="" className={classes.img}/>
            <div>Взрывные котята. Безумие, апокалипсис и котики</div>
            <div className={classes.counter}>01</div>
            <div className={classes.price}>1290 ₽</div>
            <div className={classes.old_price}>2090 ₽</div>
        </div>
    );
};

export default CardCart;
